(26, 10, 'ua', 'page_contact_footer', '<p style=\"letter-spacing: .05em;\">\n\n    Надаємо консультації стосовно працевлаштування в Польщі, допомагаємо з вибором вакансій для легальної роботи в Польщі.Ми команда професіоналів, працюємо згідно принципу ” Репутація понад усе”, нам приємно коли наші клієнти залишаються задоволеними результатом нашої роботи і надають рекомендації іншим людям які також стають нашими клієнтами і залишають хороші відгуки стосовно якості виконання нашої роботи:\n    Ми допоможемо отримати дозвіл на працю( стосовно отримання запрошення для роботи в Польщі працюємо тільки з перевіреними польськими фірмами ), консультуємо стосовно отримання візи, на кожному етапі оформлення документів гарантуємо професіональний підхід до вирішення Ваших візових питань – якщо виникли проблеми з записом на подачу документів, ми зареєструємо Вас на візу без передоплати, безкоштовно допоможемо Вам з оформленням візової анкети. Для отримання візи потрібно також страхування від акредитованих страхових компаній, надаємо консультації стосовно правильного вибору страхового полюсу в кожній окремій візовій ситуації – що зекономить Ваш час і Ваші кошти, ціни для страхування подорожуючих закордоном Вас приємно здивують.Також у нас можна замовити виготовлення пакету документів для польської робочої візи чи шенген візи “під ключ”.\n</p>\n'),
